import Reactggvfct, {useState, useEffect} from 'react'; 

import '../styles/home.css'
import Axios from 'axios'

 const AcessList = () => {
  const [acessList,setAcessList] = useState([])

  const [input, setInput] = useState("");
  const [output, setOutput] = useState([])

  useEffect(() =>{
    Axios.get("localhost:3001/api/sendText")
        .then((response) => {
           setAcessList(response.data)
        })
}, [])


useEffect(() => {
  setOutput([])

  acessList.map(val => {
    if(val.ace_cliente){
      return setOutput(output=>[...output,val])
    }
  })

},[input])


  return (
    
  <>
        <input
        className=""
          placeholder="Something that needs to be done..."
          onChange={e => setInput(e.target.value)}
        />
      
   
    {output.map((val) => {

    return(
     
            <div className="containerfull">
              <div  className="list-group">
                  <ul className="">
                      <li>Cliente: 
                          <span className="badge">{val.ace_cliente}</span>
                      </li>
                      <li>Computador:
                          <span className="badge">{val.ace_computador}</span>
                      </li>
                      <li>AnyDesk:
                          <span className="badge">{val.ace_anydesk}</span>
                      </li>
                      <li>TeamViewer:
                          <span className="badge">{val.ace_teamviewer}</span>
                      </li>
                  </ul>
                </div>
              </div>
      
            )})
     }
  </>
  )
}


export default AcessList;
